  false,\n\t\"url\": null,\n\t\"notes\": \"A GIS data set of polygon data interpreted
  from aerial photography taken by NOAA/NOS Photogrammetry Branch depicting areas
  of Aquatic Beds of Rooted Vascular Plants in coastal north Carolina. Predominantly
  submersed rooted vasculars (SRV) but including some floating rooted vasculars (FRV).
  The nomenclature and definitions originally developed according to the Coastal Land
  Cover Classification System for the NOAA Coastal Change Analysis Project (C-CAP),
  Journal of Coastal Research 9(3):862-872 have been crosswalked into the Florida
  System For Classification of Habitats in Estuarine and Marine Environments (SCHEME)
  to build consistency with similar NOAA developed benthic data sets.\",\n\t\"owner_org\":
